import Input from './Input.js'
import Connection from './Connection.js'
import Policy from './Policy.js'

const Form = ({className, form}) => {
  const {
    fields, 
    connection, 
    policy, 
    buttonText
  } = form

  const currentClassName = className
    ? `${className}__form`
    : 'form'
  const childClassName = className
    ? className
    : currentClassName

    console.log([fields]);
  return (
    <form class={currentClassName} data-name='form' id='form'>      
      {fields.length && (
        fields.map(field => 
          <Input 
            className={childClassName} 
            field={field}
            key={field.type}
          />
        )
      )}
      {/* ${connection ? Connection(connection, childClassName) : ''}
      ${policy ? Policy(policy, childClassName) : ''} */}
      <button 
        data-name='submit'
        className='${childClassName}__btn' 
        type='submit' 
        disabled
      >
        <span>${buttonText ? buttonText : 'Submit'}</span>
      </button>      
    </form>
  )
}

export default Form
